import React from 'react';
import './App.css';
import logo from './logo.svg';
import lebron from './lebron.jpg';
import { NavLink, Switch, Route } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <img src={logo} className="logo" alt="logo" />
      <header>
      <div class="container">
        <nav>
          <ul>
            <li><NavLink exact activeClassName="current" to='/'>Z</NavLink></li>
            <li><NavLink exact activeClassName="current" to='/live'>LIVE</NavLink></li>
          </ul>
        </nav>
      </div>
      </header>
        <div class="verbar">
          <header>
            <div class="profile">
              <h2>Welcome, <b>lakersfan2020</b></h2>
              <p><img src={lebron} className="lebron" alt="lebron"/>\nACS score: 100\nFANALYST</p>
            </div>
            <nav>
              <ul>
                <li><NavLink exact activeClassName="current" to='/my-account'>MY ACCOUNT</NavLink></li>
                <li><NavLink exact activeClassName="current" to='/open-court'>OPEN COURT</NavLink></li>
                <li><NavLink exact activeClassName="current" to='/trivia'>TRIVIA</NavLink></li>
                <li><NavLink exact activeClassName="current" to='/picks'>PICKS</NavLink></li>
                <li><NavLink exact activeClassName="current" to='/analyze'>ANALYZE</NavLink></li>
              </ul>
            </nav>
          </header>
      </div>
    <Main />
    </div>
  );
}

const Home = () => (
  <div className='home'>
    <h1>HOME</h1>
    <p>insert feed</p>
  </div>
);

const MyAccount = () => (
  <div className='my-account'>
    <h1>MY ACCOUNT</h1>
    <p>Edit your SPORTCRED account</p>
    <p>add log out button</p>
  </div>
);

const Trivia = () => (
  <div className='trivia'>
    <h1>TRIVIA</h1>
    <p>Let's play!</p>
  </div>
);

const Picks = () => (
  <div className='picks'>
    <h1>PICKS</h1>
    <p>Choose your pick!</p>
  </div>
);

const OpenCourt = () => (
  <div className='open-court'>
    <h1>OPEN COURT</h1>
    <p> idk</p>
  </div>
);

const Analyze = () => (
  <div className='analyze'>
    <h1>ANALYZE</h1>
    <p>idk,,,</p>
  </div>
);

const Live = () => (
  <div className='live'>
    <p>coming soon...</p>
  </div>
);

const Main = () => (
  <Switch>
    <Route exact path='/' component={Home}></Route>
    <Route exact path='/my-account' component={MyAccount}></Route>
    <Route exact path='/open-court' component={OpenCourt}></Route>
    <Route exact path='/trivia' component={Trivia}></Route>
    <Route exact path='/picks' component={Picks}></Route>
    <Route exact path='/analyze' component={Analyze}></Route>
    <Route exact path='/live' component={Live}></Route>
  </Switch>
);

export default App;
